import { useNavigate } from "react-router-dom";
import brave4Image from "../styles/images/brave4.jpeg";

const Contentt = () => {
  const navigate = useNavigate();
  return (
    <div className="container center">
      <h3>Contentt</h3>
      <div className="foto">
        <img src={brave4Image} alt="" />
      </div>
      <div>
        
      </div>
      <p>
          Lorem ipsum dolor sit amet consectetur, adipisicing elit. Maxime nemo
          delectus quidem libero commodi iste architecto debitis fuga sapiente
          dolorem! Repudiandae error a ipsum, voluptate minus architecto.
          Dolores, quod voluptatibus. Eum ad iste mollitia odio, excepturi
          dolores. Porro quam corporis consectetur dolor itaque reiciendis saepe
          laborum architecto ducimus doloribus consequuntur voluptatibus magnam
          asperiores, assumenda provident temporibus atque alias ut iusto.
          Autem, ab dolorum? Magni ratione nostrum tempore accusamus
          consequatur. Similique accusantium quis iusto quasi sequi consequatur
          minima laudantium corrupti voluptatibus sed quisquam illo consectetur
          excepturi et, repudiandae atque nesciunt consequuntur.
        </p>
      <button className="kembali" onClick={() => navigate("/")}>
        Cover
      </button>
    </div>
  );
};

export default Contentt;
